contracts/DrugTracking.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract DrugTracking {

    struct Batch {
        string batchId;
        bool isFaulty;
        uint256 supplyNumber;
        address manufacturer;
        uint256 manufactureDate;
        uint256 expirationDate;
    }

    struct Drug {
        string serialNumber;
        string batchId;
        address currentOwner;
        address[] previousOwners;
        bool isVerified;
        bool isAddedbyUser;
    }

    mapping(string => Batch) public batches; 
    mapping(string => Drug) public drugs;
    mapping(string => string[]) public batchToDrugs;
    mapping(string => address[]) public drugHistory;

    event BatchCreated(string batchId, address indexed manufacturer, uint256 supplyNumber);
    event DrugCreated(string serialNumber, string batchId, address indexed owner);
    event DrugTransferred(string serialNumber, address indexed newOwner);
    event BatchMarkedFaulty(string batchId);
    event SupplyNumberAlert(string batchId, uint256 incorrectSupplyNumber);

    modifier onlyBatchExists(string memory _batchId) {
        require(batches[_batchId].manufacturer != address(0), "Batch does not exist");
        _;
    }

    modifier onlyOwner(string memory _serialNumber) {
        require(drugs[_serialNumber].currentOwner == msg.sender, "Not the current owner");
        _;
    }

    modifier drugExists(string memory _serialNumber) {
        require(drugs[_serialNumber].currentOwner != address(0), "Drug does not exist");
        _;
    }

    function createBatch(
        string memory _batchId, 
        uint256 _supplyNumber, 
        uint256 _manufactureDate, 
        uint256 _expirationDate
    ) public {
        require(batches[_batchId].manufacturer == address(0), "Batch already exists");
        batches[_batchId] = Batch({
            batchId: _batchId,
            isFaulty: false,
            supplyNumber: _supplyNumber,
            manufacturer: msg.sender,
            manufactureDate: _manufactureDate,
            expirationDate: _expirationDate
        });

        emit BatchCreated(_batchId, msg.sender, _supplyNumber);
    }

    function createDrug(
        string memory _serialNumber,
        string memory _batchId
    ) public onlyBatchExists(_batchId) {
        require(drugs[_serialNumber].currentOwner == address(0), "Drug already exists");

        address[] memory emptyArray;
        drugs[_serialNumber] = Drug({
            serialNumber: _serialNumber,
            batchId: _batchId,
            currentOwner: msg.sender,
            previousOwners: emptyArray,
            isVerified: false,
            isAddedbyUser: false
        });
        batchToDrugs[_batchId].push(_serialNumber);
        drugHistory[_serialNumber].push(msg.sender);
        emit DrugCreated(_serialNumber, _batchId, msg.sender);
    }

    function transferDrug(string memory _serialNumber, address _newOwner, uint _supplyNumber) public onlyOwner(_serialNumber) {
        Drug storage drug = drugs[_serialNumber];
        Batch memory batch = batches[drug.batchId];

        if (batch.supplyNumber != _supplyNumber) {
            emit SupplyNumberAlert(drug.batchId, _supplyNumber);
            return;
        }
        drug.previousOwners.push(drug.currentOwner);
        drug.currentOwner = _newOwner;
        drugHistory[_serialNumber].push(_newOwner);

        emit DrugTransferred(_serialNumber, _newOwner);
    }

    function markBatchFaulty(string memory _batchId) public onlyBatchExists(_batchId) {
        batches[_batchId].isFaulty = true;
        emit BatchMarkedFaulty(_batchId);

        for (uint i = 0; i < batchToDrugs[_batchId].length; i++) {
            string memory drugSerial = batchToDrugs[_batchId][i];
            drugs[drugSerial].isVerified = false; 
        }
    } 

    function markDrugFaulty(string memory _serialNumber) public drugExists(_serialNumber) onlyOwner(_serialNumber) {
        drugs[_serialNumber].isVerified = false;
        markBatchFaulty(drugs[_serialNumber].batchId);
    }

    function getDrugDetails(string memory _serialNumber) public view drugExists(_serialNumber) returns (
        string memory batchId,
        address currentOwner,
        bool isVerified,
        bool isBatchFaulty,
        uint256 supplyNumber
    ) {
        Drug memory drug = drugs[_serialNumber];
        Batch memory batch = batches[drug.batchId];
        return (drug.batchId, drug.currentOwner, drug.isVerified, batch.isFaulty, batch.supplyNumber);
    }

    function getDrugHistory(string memory _serialNumber) public view drugExists(_serialNumber) returns (address[] memory) {
        return drugHistory[_serialNumber];
    }

    function verifyDrug(string memory _serialNumber) public drugExists(_serialNumber) {
        drugs[_serialNumber].isVerified = true;
    }

}

contracts/DrugVerification.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract DrugVerification {
    mapping(string => bool) public verifiedBatches;
    mapping(string => bool) public flaggedBatches;
    mapping(string => bool) public verifiedDrugs;
    mapping(string => bool) public flaggedDrugs;

    event BatchVerified(string batchId, bool isVerified);
    event BatchFlagged(string batchId, bool isFlagged);
    event DrugFlagged(string serialNumber, bool isFlagged);
    event SupplyNumberAlert(string batchId, uint256 incorrectSupplyNumber);

    modifier drugExists(string memory _serialNumber) {
        require(verifiedDrugs[_serialNumber] || flaggedDrugs[_serialNumber], "Drug not found");
        _;
    }

    modifier batchExists(string memory _batchId) {
        require(verifiedBatches[_batchId] || flaggedBatches[_batchId], "Batch not found");
        _;
    }

    function verifyBatch(string memory _batchId) public {
        verifiedBatches[_batchId] = true;
        emit BatchVerified(_batchId, true);
    }

    function flagBatch(string memory _batchId) public {
        flaggedBatches[_batchId] = true;
        emit BatchFlagged(_batchId, true);
    }

    function flagDrug(string memory _serialNumber) public drugExists(_serialNumber) {
        flaggedDrugs[_serialNumber] = true;
        emit DrugFlagged(_serialNumber, true);
    }

    function isBatchVerified(string memory _batchId) public view batchExists(_batchId) returns (bool) {
        return verifiedBatches[_batchId];
    }

    function isBatchFlagged(string memory _batchId) public view batchExists(_batchId) returns (bool) {
        return flaggedBatches[_batchId];
    }

    function isDrugFlagged(string memory _serialNumber) public view drugExists(_serialNumber) returns (bool) {
        return flaggedDrugs[_serialNumber];
    }

    function alertSupplyNumberDiscrepancy(string memory _batchId, uint256 _incorrectSupplyNumber) public {
        // Trigger an alert if there is a supply number discrepancy
        emit SupplyNumberAlert(_batchId, _incorrectSupplyNumber);
    }
}

contracts/EventLogging.sol.content:
// SPDX-License-Identifier: MIT.
pragma solidity ^0.8.0;

contract EventLogging {
    struct Event {
        string batchOrSerialId;
        string eventType;
        address eventOwner;
        uint256 timestamp;
        string details;
        uint256 supplyNumber;
    }

    mapping(string => Event[]) public eventsLog;

    event EventLogged(string batchOrSerialId, string eventType, address indexed eventOwner, uint256 timestamp, string details, uint256 supplyNumber);

    function logEvent(string memory _batchOrSerialId, string memory _eventType, string memory _details, uint256 _supplyNumber) public {
        Event memory newEvent = Event({
            batchOrSerialId: _batchOrSerialId,
            eventType: _eventType,
            eventOwner: msg.sender,
            timestamp: block.timestamp,
            details: _details,
            supplyNumber: _supplyNumber
        });
        eventsLog[_batchOrSerialId].push(newEvent);
        emit EventLogged(_batchOrSerialId, _eventType, msg.sender, block.timestamp, _details, _supplyNumber);
    }

    function getEvents(string memory _batchOrSerialId) public view returns (Event[] memory) {
        return eventsLog[_batchOrSerialId];
    }

}

contracts/Registration.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Registration {

    struct Stakeholder {
        address stakeholderAddress;
        string role;
        bool isRegistered;
    }

    mapping(address => Stakeholder) public stakeholders;
    address[] public stakeholderList;

    string[] private validRoles = ["PHARMA_COMPANY", "MANUFACTURER", "RETAILER", "END_USER"];

    event StakeholderRegistered(address stakeholder, string role);

    modifier onlyRegistered() {
        require(stakeholders[msg.sender].isRegistered, "Not registered");
        _;
    }

    function isValidRole(string memory _role) private view returns (bool) {
        for (uint256 i = 0; i < 4; i++) {
            /*
            he code is checking if the _role (the input role) matches 
            any of the strings stored in the validRoles array by comparing 
            their keccak256 hashes. Since comparing hashes is much faster and secure than comparing strings directly, this is a common pattern in Solidity for string comparisons.
            */
            if (keccak256(abi.encodePacked(validRoles[i])) == keccak256(abi.encodePacked(_role))) {
                return true;
            }
        }
        return false;
    }

    function registerStakeholder(address _stakeholderAddress, string memory _role) public {
        require(!stakeholders[_stakeholderAddress].isRegistered, "Already registered");
        require(isValidRole(_role), "Invalid role");

        stakeholders[_stakeholderAddress] = Stakeholder({
            stakeholderAddress: _stakeholderAddress,
            role: _role,
            isRegistered: true
        });
        stakeholderList.push(_stakeholderAddress);
        emit StakeholderRegistered(_stakeholderAddress, _role);
    }

   function getStakeholderDetails(address _stakeholderAddress) public view returns (string memory role, bool registered) {
    require(stakeholders[_stakeholderAddress].isRegistered, "Stakeholder not found");
    return (stakeholders[_stakeholderAddress].role, stakeholders[_stakeholderAddress].isRegistered);
}

    function isRegistered(address _stakeholderAddress) public view returns (bool) {
        return stakeholders[_stakeholderAddress].isRegistered;
    }

    function getStakeholders() public view returns (address[] memory) {
        return stakeholderList;
    }

}

